import React from 'react';
import ScrollAnim from 'rc-scroll-anim';
import content from './SectionsContent';
import iniciaScroll from './Scroll';
import Twn from './Twn';
import Transition from './Transition';
import DialogTransition from './DialogTransition';
import Slide from '@material-ui/core/Slide';
const Link = ScrollAnim.Link;
const ScrollOverPack = ScrollAnim.OverPack;


const find = id => content.find(p => p.id === id);

function DialTransition(props) {
    return <Slide direction="down" {...props}/>;
}

const OverPack = ({data}) => {
    let n = find(data.params.id);

    return (
        <ScrollOverPack
            always={true}
            appear={true}
                // componentProps={{ tweenOne2:  {reverse: true}, tweenOne:  {reverse :true } }}
            className={n.classe}
            id={n.hash}
            playScale={0.5}
            >
            {Twn({n: n, key: 'tweenOne2', reverse: true})}
            {Transition({n: n, key: 'tweenOne', reverse: true})}<Link
                className="ver_mais"
                onClick={this.handleClickOpen}
                style={{
                position: 'fixed',
                height: '4em',
                bottom: '10vh',
                left: 0,
                zIndex: 999999,
                cursor: 'pointer'
            }}>
                 {'ver projeto' +n.id}
            </Link>
        </ScrollOverPack>
    )
}
class Home extends React.Component {
    componentDidMount() {
        // iniciaScroll();
    }
    render() {

        return (
            content.map((i) => (<OverPack
            data={{
            params: {
                id: i.id
            }
        }}></OverPack>)));
    }
}

export default Home;
